rawEvents.push("405: The Christian Gospel is translated into Latin.[1]"), rawEvents.push("410:Rome is sacked by Alaric, King of the Visigoths. Decisive event in the decline of the Western Roman Empire.[2]"), rawEvents.push("431:Council of Ephesus Confirmed the original Nicene Creed,[3] and condemned the teachings of Nestorius, Patriarch of Constantinople, that led to his exile and separation with the Church of the East."), rawEvents.push('455:Rome is sacked by Genseric, King of the Vandals.[4] Another decisive event in the Fall of Rome and held by some historians to mark the "end of the Roman Empire".[5]'), rawEvents.push("476:Odoacer deposes the last Roman Emperor Romulus Augustulus Considered by many to be the starting point of the Middle Ages[6]"), rawEvents.push("500:Battle of Mons Badonicus. The West Saxon advance is halted by Britons in England. Chiefly known today for the supposed involvement of King Arthur but because of the limited number of sources, there is no certainty about the date, location, or details of the fighting.[7][8]"), rawEvents.push("524:Boethius writes his Consolation of Philosophy It has been described as the single most important and influential work in the West on Medieval and early Renaissance Christianity.[10]"), rawEvents.push("527:Justinian I becomes Eastern Roman Emperor. Justinian is best remembered for his Code of Civil Law (529), and expansion of imperial territory retaking Rome from the Ostrogoths."), rawEvents.push("529â€”534:Justinian I publishes the Code of Civil Law. This compiled centuries of legal writings and imperial pronouncements into three parts of one body of law."), rawEvents.push("529:Benedict of Nursia founds monastery at Monte Cassino. The first of twelve monasteries founded by Saint Benedict, beginning the Order of Saint Benedict."), rawEvents.push("533:Byzantines, under Belisarius, retake North Africa from the Vandals. Vandal kingdom ends and the Reconquest of North Africa is completed."), rawEvents.push("563:Saint Columba founds mission in Iona. Constructed an abbey which helped convert the Picts to Christianity until it was destroyed and raided by the Vikings in 794.[12]"), rawEvents.push("570:Muhammed is born. Professed receiving revelations from God, which were recorded in the Qur'an, the basis of Islamic theology, in which he is regarded as the most important prophet."), rawEvents.push("581â€”618:Sui Dynasty in China. China unified once again during this period for the first time in almost 400 years."), rawEvents.push("590:Gregory the Great becomes Pope. The missionary work reached new levels during his pontificate, revolutionized the way of worship for the Catholic Church (Gregorian Chants), liturgy, etc., and was soon canonized after his death."), rawEvents.push("597:Augustine arrives in Kent. Christianization of England (Anglo-Saxons) begins."), rawEvents.push("602â€”629:Last great Roman-Persian War. Long conflict leaves both empires exhausted and unable to cope with the newly united Arab armies under Islam in the 630s"), rawEvents.push("622:Muhammad Migrates from Mecca to Medina. Event will have designated first year of the Islamic Calendar, as Anno Hegirae."), rawEvents.push("632:Death of Muhammed. By this point, all of Arabia is Muslim."), rawEvents.push("632:Accession of Abu Bakr as first Caliph. Though the period of his caliphate was not long, it included successful invasions of the two most powerful empires of the time."), rawEvents.push("638:Jerusalem captured by the Arab army, mostly Muslims, but with contingents of Syrian Christians.Muslims. "), rawEvents.push("663:Synod of Whitby. Roman Christianity triumphs over Celtic Christianity in England."), rawEvents.push("674-678:First Arab siege of Constantinople. First time Islamic armies defeated, forestalling Islamic conquest of Europe."), rawEvents.push("711:Muslims - Arabs and Berbers, under Tariq Ibn Zeyad Tarik invade the Iberian peninsula. Will begin a period of Muslim rule within in the Iberian peninsula (with various portions of land) until nearly the end of the Fifteenth Century."), rawEvents.push("726:Iconoclast movement begun in the Byzantine Empire under Leo III. This was opposed by Pope Gregory II, and an important difference between the Roman and Byzantine churches. "), rawEvents.push("732:Battle of Tours. Charles Martel halts Muslim advance. Significant moment that led to the forming of the Carolingian Empire for the Franks, and halted the advancement of the Moors in southwestern Europe."), rawEvents.push("750:Beginning of Abbasid Caliphate. Would become the longest lasting caliphate, until 1519 when conquered and annexed into the Ottoman Empire."), rawEvents.push("754:Pepin promises the Pope central Italy. This is arguably the beginning of the temporal power of the Papacy. "), rawEvents.push("768:Beginning of Charlemagne's reign. "), rawEvents.push("793:Sack of Lindisfarne. Viking attacks on Britain begin. Generally considered the beginning of the Viking Age that would span over two centuries, and reach as far south as Hispania and as far east as the Byzantine Empire, and present day Russia."), rawEvents.push("800:Charlemagne is crowned Holy Roman Emperor. With his crowning, Charlemagne's kingdom is officially recognized by the Papacy as the largest in Europe since the fall of the Roman Empire."), rawEvents.push("814:Death of Charlemagne. Would be a factor towards the splitting of his empire almost 30 years later."), rawEvents.push("843:Division of Charlemagne's Empire between his grandsons with the Treaty of Verdun. Sets the stage for the founding of the Holy Roman Empire and France as separate states."), rawEvents.push("871:Alfred the Great assumes the throne, the first king of a united England. He defended England from Viking invaders, formed new laws and fostered a rebirth of religious and scholarly activities."), rawEvents.push("885:Arrival of the disciples of Saints Cyril and Methodius in Bulgaria Creation of the Cyrillic script; in the following decades the country became the cultural and spiritual centre of the whole Eastern Orthodox part of the Slavic World."), rawEvents.push("910:Cluny Abbey is founded by William I, Count of Auvergne. Cluny goes on to become the acknowledged leader of Western Monasticism. Cluniac Reforms initiated with the abbey's founding."), rawEvents.push("962:Otto the Great crowned the Holy Roman Emperor. First to be crowned Holy Roman Emperor in nearly 40 years."), rawEvents.push("963-964:Otto deposes Pope John XII who is replaced with Pope Leo VIII. Citizens of Rome promise not to elect another Pope without Imperial approval."), rawEvents.push("989:Peace and Truce of God formed. The first movement of the Catholic Church using spiritual means to limit private war, and the first movement in medieval Europe to control society through non-violent means."), rawEvents.push("1001:Leif Ericson is to settle during the winter in present day Canada at L'Anse aux Meadows. Ericson is to be the first European to settle in the Americas during the Norse exploration of the Americas."), rawEvents.push("1021:The Tale of Genji, written by Murasaki Shikibu, is completed sometime before this date.[17] It is sometimes called the world's first novel, the first modern novel, the first psychological novel or the first novel still to be considered a classic.[18]"), rawEvents.push("1049:Pope Leo IX ascends to the papal throne. Leo IX was the pope that excommunicated Patriarch of Constantinople, Michael Cerularius (who also excommunicated Leo), which caused the Great Schism."), rawEvents.push("1050:The astrolabe, an ancient tool of navigation, is first used in Europe. Early tool of marine navigators, astrologers, astronomers."), rawEvents.push("1054:The East-West Schism which divided the church into Western Catholicism and Eastern Orthodoxy. Tensions will vary between the Catholic and Orthodox churches throughout the Middle Ages."), rawEvents.push("1066:William the Conqueror, Duke of Normandy, invades England and becomes King after the Battle of Hastings. End of Anglosaxon rule in England and start of Norman lineage."), rawEvents.push("1067:Pope Gregory VII elevated to the papal throne. This begins a period of church reform."), rawEvents.push("1075:Dictatus Papae in which Pope Gregory VII defines the powers of the pope. Peak of the Gregorian Reform, and an immense factor in the Investiture Controversy."), rawEvents.push("1077:Holy Roman Emperor Henry IV walks to Canossa where he stands barefoot in the snow to beg forgiveness of the Pope for his offences, and admitting defeat in the Investiture Controversy. This helps establish Papal rule over European heads of state for another 450 years."), rawEvents.push("1077:The Construction of the Tower of London begins. The tower of London was the ultimate keep of the British Empire."), rawEvents.push("1095:Pope Urban issues the Crusades to capture the Holy Land, and to repel the Seljuk Turks from the Byzantine Empire from Alexios I Komnenos. This would be the first of 9 Major Crusades, and a number of other crusades that would spread into the late 13th century."), rawEvents.push("1098:The Cistercian Order is founded. Was a return to the original observance of the Rule of St. Benedict."), rawEvents.push("1099:First Crusade. Jerusalem is re-taken from the Muslims on the urging of Pope Urban II. This would lead to the beginning of the Kingdom of Jerusalem, which would last for nearly two centuries; within the era of the Crusades to the Holy Land."), rawEvents.push("1107:Through the Compromise of 1107, suggested by Adela, the sister of King Henry, the Investiture Struggle in England is ended. This compromise removed one of the points of friction between the English monarchy and the Catholic Church."), rawEvents.push("1118:The Knights Templar are founded to protect Jerusalem and European pilgrims on their journey to the city. Becomes the most recognizable, and impactful military orders during the Crusades."), rawEvents.push("1121:St. Norbert and 29 companions make their solemn vows marking the beginning of the Premonstratensian Order. This order played a significant role in evangelizing the Slavs, the Wends, to the east of the Holy Roman Empire."), rawEvents.push("1122:The Concordat of Worms was drawn up between Emperor Henry V and Pope Calixtus II. This concordat ended the investiture struggle, but bitter rivalry between emperor and pope remained."), rawEvents.push("1139:The Second Lateran Council declared clerical marriages invalid, regulated clerical dress, and punished attacks on clerics by excommunication. Enforces the major reforms that Gregory VII began to heavily campaign for several decades earlier."), rawEvents.push("1147â€“1149:The Second Crusade was in retaliation for the fall of Edessa, one of the first Crusader States founded in the First Crusade. It was an overall failure. This was the first Crusade to have been led by European kings."), rawEvents.push("1152:The Synod of Kells-Mellifont established the present diocesan system of Ireland (with later modifications) and recognized the primacy of Armagh. This synod marks the inclusion of the Irish Church into mainstream European Catholicism."), rawEvents.push("1175:HÅnen ShÅnin (GenkÅ«) founds the JÅdo shÅ« (Pure Land) sect of Buddhism. This event marks the beginning of the Buddhist sectarian movement in Japan."), rawEvents.push("1179:The Third Lateran Council limits papal electees to the cardinals alone, condemns simony, and forbids the promotion of anyone to the episcopate before the age of thirty. "), rawEvents.push("1184:Pope Lucius III issues the papal bull Ad Abolendam. This bull set up the organization of the medieval inquisitions."), rawEvents.push("1185:Windmills are first recorded. "), rawEvents.push("1187:Saladin recaptures Jerusalem. Would lead to the Third Crusades."), rawEvents.push("1189â€“1192:The Third Crusade follows upon Saladin's uniting the Muslim world and recapturing Jerusalem. Despite managing to win several major battles, the Crusaders did not recapture Jerusalem."), rawEvents.push("1193:Turkic Muslim invaders sack and burn the university at Nalanda. This is the beginning of the decline of Buddhism in India."), rawEvents.push("1202:The Fourth Crusade sacked Croatian town of Zadar (Italian: Zara), a rival of Venice. Unable to raise enough funds to pay to their Venetian contractors, the crusaders agreed to sack the city despite letters from Pope Innocent III forbidding such an action and threatening excommunication. Siege of Zara was the first major Crusade's action and the first attack against a Catholic city by Catholic crusaders."), rawEvents.push("1204:Sack of Constantinople during the Fourth Crusade. Considered to be the beginning of the decline of the Byzantine Empire."), rawEvents.push("1208:Pope Innocent III calls for the Albigensian Crusade which seeks to destroy a rival form of Christianity practiced by the Cathars. "), rawEvents.push("1209:Founding of the Franciscan Order. One of the more significant orders in the Roman Catholic church, founded by Saint Francis of Assisi."), rawEvents.push("1212:Spanish Christians succeed in defeating the Moors in the long Reconquista campaigns, after the Battle of Las Navas de Tolosa. By 1248, only the small southern kingdom of Granada remained under Muslim control."), rawEvents.push("1215:The Magna Carta is sealed by John of England. This marks one of the first times a medieval ruler is forced to accept limits on his power."), rawEvents.push("1215:Fourth Lateran Council. Dealt with transubstantiation, papal primacy and conduct of clergy. Proclaimed that Jews and Muslims should wear identification marks to distinguish them from Christians. "), rawEvents.push("1216:Papal recognition of the Dominican Order. "), rawEvents.push("1219:Serbian Orthodox Church becomes autocephalous under St. Sava, its first Archbishop. "), rawEvents.push("1257:Provisions of Oxford forced upon Henry III of England. This establishes a new form of government-limited regal authority."), rawEvents.push("1258:Siege of Baghdad Mongols (the Ilkhanate) ensure control of the region; Generally considered the end of the Islamic Golden Age."), rawEvents.push("1272-73:The Ninth Crusade occurs. Considered to be the Last Major Crusade to take place in the Holy Land."), rawEvents.push("1274:Thomas Aquinas' work, Summa Theologica is published, after his death. Is the main staple of theology during the Middle Ages."), rawEvents.push("1298:Marco Polo publishes his tales of China, along with Rustichello da Pisa. A key step to the bridging of Asia and Europe in trade."), rawEvents.push("1307:The Knights Templar are rounded up and murdered by Philip the Fair of France, with the backing of the Pope. Hastens the demise of the order within a decade."), rawEvents.push("1307:Beginning of the Babylonian Captivity of the Papacy during which the Popes moved to Avignon. Begins a period of over seven decades of the Papacy outside of Rome that would be one of the major factors of the Western Schism."), rawEvents.push("1310:Dante publishes his Divine Comedy. Is one of the most defining works of literature during the Late Middle Ages, and among the most recognizable in all of literature."), rawEvents.push("1325:The Aztecs found the city of Tenochtitlan. This would be the epicenter and capital of the Aztec kingdom for nearly 200 years until the Siege of Tenochtitlan led by HernÃ¡n CortÃ©s."), rawEvents.push("1337:The Hundred Years' War begins. England and France struggle for a dominating position in Europe and their region. The war will span through three/four different war periods within a 116 year period."), rawEvents.push("1347:The Black Death ravages Europe for the first of many times. An estimated 20% - 40% of the population is thought to have perished within the first year. The first of many concurrences of this plague, This was believed to have wiped out as many as 50% of Europe's population by its end."), rawEvents.push("1378:The Western Schism during which three claimant popes were elected simultaneously. The Avignon Papacy ends."), rawEvents.push("1380:Chaucer begins to write The Canterbury Tales. Chaucer's greatest work, and one of the foundations towards the formation of the Modern English language"), rawEvents.push("1381:The Bible is translated into English by John Wycliffe. First print published in English (Vulgate)"), rawEvents.push("1396:The Battle of Nicopolis. The last great Crusade fails."), rawEvents.push("1415:Battle of Agincourt. Henry V and his army defeat a numerically superior French army, partially because of the newly introduced English longbow. The turning point in the Hundred Years' War for 15th Century England that lead to the signing of the Treaty of Troyes signed 5 years later, making Henry V heir of France."), rawEvents.push("1417:The Council of Constance ends. The Western Schism comes to a close, and elects Pope Martin V as the sole pope."), rawEvents.push("1429:Joan of Arc lifts the siege of OrlÃ©ans for the Dauphin of France, enabling him to eventually be crowned at Reims. The battle at OrlÃ©ans is the first of many which ultimately drive the English from continental Europe."), rawEvents.push("1431:Trial and execution of Joan of Arc. Death of the woman who helped turned the Hundred Years' War in favor of the French over the past two years."), rawEvents.push("1434:The Medici family rises to prominence in Florence. This ushers in a period of significance of the Medici's, such as bankers, popes, queens (regents) and dukes, throughout Europe (mainly Italy, especially the Florentine Republic), over the next three centuries."), rawEvents.push("1439:Johannes Gutenberg invents the printing press. Literature, News, etc. becomes more accessible throughout Europe."), rawEvents.push("1453:The Hundred Years' War ends. England's once vast territories in France is now reduced to only Calais, which they eventually lose control of as well."), rawEvents.push("1455:Battle of St. Albans Traditionally marks the beginning of the War of the Roses."), rawEvents.push("1485:Thomas Malory composes Le Morte d'Arthur Perhaps the best-known work of Arthurian literature in English."), rawEvents.push("1487:Battle of Stoke. Marks end of the War of the Roses."), rawEvents.push("1492:Christopher Columbus reaches the New World. Age of Discovery into the New World begins."), rawEvents.push("1497:Vasco da Gama begins his first voyage from Europe to India and back. Vasco da Gama was the first European to sail directly to Eastern Asia from Europe."), rawEvents.push("1499:Ottoman fleet defeats Venetians at the Battle of Zonchio. The first naval battle that used cannons in ships."), parseEventsNotParsed(historyNotes, rawEvents, thisSource);
